import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';


const App = () => {
  const baseUrl = 'https://jsonplaceholder.typicode.com/todos/1';

  const [data, setData] = useState("");

  useEffect(() => {
    axios.get(baseUrl)
      .then(res => {
        console.log(res);
        setData(res.data.title);
      })
      .catch(error => {
        if (error.response) {
          console.log("This is response.data", error.response.data);
          console.log("This is response.status", error.response.status);
          console.log("This is response.headers", error.response.headers);
        } else if (error.request) {
          console.log("This is error.request", error.request);
        } else {
          console.log('This is error.message', error.message);
        }
        console.log("This is error.config", error.config);
      })
  }, []);


  // Want to use async/await? Add the `async` keyword to your outer function/method.
  // async function getUser() {
  //   try {
  //     const response = await axios.get('/user?ID=12345');
  //     console.log(response);
  //   } catch (error) {
  //     console.error(error);
  //   }
  // }






  return (
    <div className="App">
      <button>
        Click Me
      </button>
      {data}
    </div>
  );
};

export default App;
